$stage_2 = "";

for ($i = 0; $i < strlen($stage_1); $i ++) {
	if ($stage_1[$i] == "!") {
		$i ++;
	} else {
		$stage_2 .= $stage_1[$i];
	}
}

$stage_3 = "";
$adding = true;
for ($i = 0; $i < strlen($stage_2); $i ++) {
	if ($adding) {
		if ($stage_2[$i] == "<") $adding = false;
		else $stage_3 .= $stage_2[$i];
	} else {
		if ($stage_2[$i] == ">") $adding = true;
	}
}

$stage_4 = "";
for ($i = 0; $i < strlen($stage_3); $i ++) {
	if ($stage_3[$i] == ",") continue;
	$stage_4 .= $stage_3[$i];
}

$score = 0;

while (strlen($stage_4) > 0) {
	$last_opening_curly = 0;
	for ($i = 0; $i < strlen($stage_4); $i ++) {
		if ($stage_4[$i] == "{") $last_opening_curly = $i;
	}
	$score += (strlen($stage_4) - $last_opening_curly) - 1;
	$stage_4 = substr($stage_4, 0, $last_opening_curly).substr($stage_4, $last_opening_curly + 2);
}
echo $score."\n";